column8:
ショコラトプレーはフレンチポスターの代表作<BR>
ポスターをフレーム(額縁)にセットしました。<BR><BR>

美味しそうにチョコレートを食べている男の子<BR>
大変人気あるポスターです。<BR><BR>

インテリア雑誌のようにそのまま、立て掛けて<BR>
置くだけの飾り方が新鮮です。<BR><BR>

壁に掛ける為のヒモも付属しています。<BR><BR>
<FONT SIZE="2">
フランスEditionsclouet社がSavignacとの契約締結<BR>
により製作したポスターです。<BR>
ポスターサイズ：500×700mm<BR>
フレームの外寸：535×735mm厚み13mm枠の幅23mm<BR>
フレーム素材：木製、透明1mmフイルム使用<BR>
フレームのカラー：ホワイト艶消し、<BR>
ガラスを使用していませんので、地震の際も安全です。<BR></FONT><br><br>

